import React from 'react';
import './App.css';
import 'tachyons';
import './index.css';
import Logos from './Logos';
import Desc from './description';
import SearchFunc from './SearchSection';
import ParticlesBg from 'particles-bg';

class App extends React.Component{

  render()
    {
     return (
    <div className="App">
      <h3 className='link underline  pa3 f4 pointer  dib dim white' style={{display:'flex', justifyContent:'end'}}>Sign Out</h3>

    <ParticlesBg type='lines' bg={true} />
    <Logos />
    <Desc />
    <SearchFunc />
    </div>
  );
}
}
export default App;
